import pizzaData from "./../../public/data";

function Pizza() {
  return pizzaData.map((el) => {
    return <h2>el.name</h2>;
  });
}

function Menu() {
  return (
    <div className="menu">
      <h2>Our menu</h2>
      <Pizza />
    </div>
  );
}

export default Menu;
